package nl.takmk;

import java.io.File;
import java.io.FileNotFoundException;
import java.util.ArrayList;
import java.util.Scanner;

public class Day0501 {

    public final static String[] polymers = {
            "aA", "Aa", "bB", "Bb", "cC", "Cc", "dD", "Dd", "eE", "Ee", "fF", "Ff", "gG", "Gg",
            "hH", "Hh", "iI", "Ii", "jJ", "Jj", "kK", "Kk", "lL", "Ll", "mM", "Mm", "nN", "Nn",
            "oO", "Oo", "pP", "Pp", "qQ", "Qq", "rR", "Rr", "sS", "Ss", "tT", "Tt", "uU", "Uu",
            "vV", "Vv", "wW", "Ww", "xX", "Xx", "yY", "Yy", "zZ", "Zz"};



    public static void main(String[] args) throws FileNotFoundException {

    //    ArrayList<String> input = readFile("input-day05.txt");

        int lastLength = input.length()+1;

        while(input.length() != lastLength) {
            for (int i = 0; i < polymers.length; i++) {
                lastLength = input.length();
                input = input.replace(polymers[i], "");
                if(lastLength!=input.length()) {
                    break;
                }
            }
        }

        log(input);
        log(input.length()+"");






    }




    //-----

    private static void log(String logLine) {
        System.out.println(logLine);
    }

    private static ArrayList<String> readFile(String fileName) throws FileNotFoundException {
        ArrayList<String> input = new ArrayList<String>();
        ClassLoader classLoader = Day0501.class.getClassLoader();
        File file = new File(classLoader.getResource(fileName).getFile());

        Scanner scanner = new Scanner(file);

        while (scanner.hasNextLine()) {
            input.add(String.valueOf(scanner.nextLine()));
        }

        return input;
    }

     static String input = "";
}

